function Counter () {
    const [count, setCount] = React.useState(0);

    const handleClick = () => {
        setCount(count + 1);
    };

    return (
        <div>
        <p>The current bug count is: {count}</p>
        <button onClick={handleClick}>
            Increment
        </button>
        </div>
    );
}
